function set_wallet_address(wallet_address, receiver_address) {
    g_wallet_address = wallet_address
    fetch('/api/set_wallet',
    {method:'POST',
    headers:{'Content-type':'application/json','Wallet_address':wallet_address, 'Receiver_address':receiver_address},
    body:JSON.stringify({"wallet_address":wallet_address, 'Receiver_address':receiver_address})})
}

function addOrder(wallet_address,tx,name,invoice_id) {
    $.post("/api/add_order",
                        { wallet_address: wallet_address, tx: tx,name:name,invoice_id:invoice_id },
                         function(data, status){
                                if(data == 'OK') {
                                    alert('Order placed successfully')
                                } else {
                                    alert('Order could not place successfully')
                                }
    });
}
function getmessage(download=false){
    url = "/api/messages"
    if(download){
        window.open(url + "?download=true","_blank")
    }
    fetch(url,{method:"GET"})
    .then(response => {return response.json()})
    .then(data => {console.log(JSON.stringify(data))})
}

function connect() {
    console.log('Calling connect()')
    ethereum
    .request({ method: 'eth_requestAccounts' })
    .then(handleAccountsChanged)
    .catch((err) => {
    if (err.code === 4001) {
        // EIP-1193 userRejectedRequest error
        // If this happens, the user rejected the connection request.
        console.log('Please connect with Wallet.');
        $('#status').html('You refused to connect with Wallet')
    } else {
        console.error(err);
    }
    });
}

